const input = '';

let polymer = input.split('');


function react(polymer) {
  let remove = true;
  while (remove) {
    remove = false;
    for (let i = 1; i < polymer.length; i++) {
      if (polymer[i].toLowerCase() === polymer[i-1].toLowerCase() && polymer[i] !== polymer[i-1]) {
        polymer.splice(i-1, 2);
        remove = true;
      }
    }
  }
  return polymer.length;
}



let minSize = 0;
let types = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z'];
for (let i = 0; i < types.length; i++) {
  let filtered = polymer.filter(x => x.toLowerCase() !== types[i]);
  let reaction = react(filtered);
  if (i === 0 || reaction < minSize) {
    minSize = reaction;
  }
}

const part1 = react(polymer);
const part2 = minSize;
export default { part1, part2 }